from collections import dequedef solution(N, coffee_times):    answer = []    coffee_list = []    for i, v in enumerate(coffee_times):        coffee_list.append([i, v])    coffee_q = coffee_list[0:N]    coffee_rest = coffee_list[N:]    d = deque(coffee_q)    time = 0    # while d:    #     p = d.popleft()    #     if p[1] != time:    #         time += 1    #     if time >= p[1]:    #         answer.append(p[0]+1)    #         if len(coffee_rest) != 0:    #             d.append(coffee_rest[0])    #             coffee_rest.remove(coffee_rest[0])    #     else:    #         p[1] -= time    #         d.append(p)    while d:        p = d.popleft()        time += 1        if time >= p[1]:            answer.append(p[0]+1)            if len(coffee_rest) != 0:                d.append(coffee_rest[0])                coffee_rest.remove(coffee_rest[0])        else:            p[1] -= time            d.append(p)    return answern = 3coffee = [4, 2, 2, 5, 3]print(solution(n, coffee))# return = [2, 3, 1, 5, 4]